const INITAIL_STATE = {
    currentUser: null
};

const userReducer = (state = INITAIL_STATE, action) => {
    switch (action.type) {
        case "SET_CURRENT_USER":
            return {
                ...state,
                currentUSer: action.payload
            };
        default:
            return state;
    }
}

export default userReducer;
